import React from 'react';
import { connect } from 'react-redux';
import styled from 'styled-components';
import { logout } from '../../actions/auth';
import { deleteUser } from '../../actions/auth';
import Centering from '../../styled/Centering';
import GlobalButton from '../../styled/GlobalButton';

const StyledButton = styled(GlobalButton)`
	margin: 0;
	padding: 0;
	border: none;
	border-radius: 0;
	color: darkblue;
	background-color: lightskyblue;
`;

const LogoutUser = ({ logout, deleteUser }) => {
	return (
		<Centering>
			<StyledButton onClick={logout}>Logout</StyledButton>;
			<StyledButton onClick={logout}>Delete</StyledButton>
		</Centering>
	);
};
const mapStateToProps = (state) => ({
	logout,
	deleteUser,
});

export default connect(mapStateToProps, { logout, deleteUser })(LogoutUser);
